import React from 'react';
import Navbar from './components/Navbar/Navbar';
import './App.css';
import Gallery from './components/Gallery/Gallery';

const getData = () =>{
  let data =[
    {
      img: 'https://homepages.cae.wisc.edu/~ece533/images/airplane.png',
      height: '500',
      author:''
    },
    {
      img: 'https://homepages.cae.wisc.edu/~ece533/images/airplane.png',
      height: '500',
      author:''
    },
    {
      img: 'https://homepages.cae.wisc.edu/~ece533/images/airplane.png',
      height: '400',
      author:''
    },
    {
      img: 'https://homepages.cae.wisc.edu/~ece533/images/arctichare.png',
      height: '200',
      author:''
    },
    {
      img: 'https://homepages.cae.wisc.edu/~ece533/images/boat.png',
      height: '130',
      author:''
    },
    {
      img: 'https://homepages.cae.wisc.edu/~ece533/images/pool.png',
      height: '350',
      author:''
    }
  ]
  return data
}
function App() {
  let images = getData();
  return (
    <div className="App">
      <Navbar />
      <Gallery imgarr={images}/>
    </div>
  );
}

export default App;
